					"frFR": "Vos compétences de pyromancie ont +12% de chances d'infliger un coup critique supplémentaires et d'infliger des dégâts directs supplémentaires. Le bonus aux dégâts directs équivaut à 10% de votre bonus de dégâts de feu, jusqu'à un maximum de x30%.\n\nTags: Pyromancie, Feu, Coups critiques.",
					"itIT": "Le abilità di Piromanzia hanno una probabilità di critico aumentata del +12% e infliggono danni diretti aumentati del 10% del bonus ai danni da fuoco, fino a un massimo del x30%.\n\nTags: Piromanzia, Fuoco, Colpi critici.",
					"jaJP": "火術スキルのクリティカルヒット率が+12%上昇し、火炎ダメージボーナスの10%相当の増加した直接ダメージを与える。このダメージは最大x30%まで増加する。\n\nTags: 火術, 火炎, クリティカルヒット.",
					"koKR": "방화 기술의 극대화 확률이 +12% 증가하고 직접 피해가 화염 기술로 주는 피해 증가량의 10%만큼, 최대 x30%까지 증가합니다.\n\nTags: 방화, 화염, 극대화.",
					"plPL": "Umiejętności Piromancji mają zwiększone o +12% szanse na trafienie krytyczne i zadają zwiększone obrażenia bezpośrednie równe 10% premii do obrażeń od Ognia, maksymalnie x30%.\n\nAktualna premia do obrażeń bezpośrednich: x[min(((Damage_Type_Percent_Bonus#Fire + NonPhysical_Damage_Percent_Bonus) * 0.1), 0.3) * 100]%\n\nTags: Piromancja, Ogień, Trafienia Krytyczne.",
