					"ruRU": "Вероятность критического удара умений пиромантии повышается на +12%. Прямой урон от этих умений увеличивается на 10% от вашего бонуса к урону от огня вплоть до x30%.\n\nTags: Пиромантия, Огонь, Критические удары.",
					"trTR": "Alev Büyüsü Yetenekleri, +12% artırılmış Kritik Vuruş İhtimaline sahip olur ve Ateşle Hasar bonusunun 10% kadarına eşit artırılmış ilave Doğrudan hasar verir. Artışı en fazla x30% olabilir.\n\nTags: Alev Büyüsü, Ateş, Kritik Vuruşlar.",
					"zhCN": "爆焰技能的暴击几率增加 +12%, 并且直接伤害增加。增加的直接伤害相当于火焰伤害加成的 10%, 最高加成 x30%。\n\nTags: 爆焰, 火焰, 暴击.",
