					"plPL": "Zadajesz dodatkowe obrażenia odsłoniętym wrogom równe x10% całkowitej premii do obrażeń od Zimna, maksymalnie x30%.\n\nTags: Odsłonięcie, Zimno, Szczęśliwy Traf.",
