			"Sorcerer_Legendary_011": {
				"name": "Elemental Summoner",
				"description": "Your Conjuration Skills have a x10% reduced Cooldown or Mana cost. They also deal bonus damage equal to x5% of the total amount of your Bonus Damage with Fire, Lightning, and Cold.\n\nTags: Conjuration, Mana, Cooldown.",
				"nameLocalized": {
					"deDE": "Elementarbeschwörer",
					"esES": "Invocación elemental",
					"esMX": "Invocador Elemental",
					"frFR": "Invocation élémentaire",
					"itIT": "Evocatore Elementale",
					"jaJP": "元素召喚師",
					"koKR": "원소 소환사",
					"plPL": "Przywoływanie Żywiołów",
					"ptBR": "Evocador Elemental",
					"ruRU": "Призыватель стихий",
					"trTR": "Element Çağırıcı",
					"zhCN": "元素召唤师",
					"zhTW": "元素召喚師"
				},
				"descriptionLocalized": {
					"deDE": "Eure Beschwörungsfertigkeiten haben um x10% verringerte Abklingzeit oder Manakosten. Sie verursachen außerdem Bonusschaden in Höhe von x5% der Gesamtmenge Eures Bonusschadens mit Feuer, Blitz und Kälte.\n\nTags: Beschwörung, Mana, Abklingzeit.",
					"esES": "Tus habilidades de evocación tienen un x10% menos de tiempo de reutilización o coste de maná. Además, infligen una cantidad de daño adicional equivalente a un x5% de tu daño adicional total de fuego, rayos y frío.\n\nTags: Evocación, Maná, Tiempo de reutilización.",
					"esMX": "Tus habilidades de Conjuración tienen un x10% de reducción de recuperación o costo de maná. También infligen daño de bonificación equivalente a un x5% del monto total de daño de bonificación con fuego, rayo y frío.\n\nTags: Conjuración, Maná, Recuperación.",
					"frFR": "Vos compétences de conjuration ont un temps de recharge ou un coût en mana réduit de x10%. Elles infligent également un bonus aux dégâts équivalent à x5% du total de votre bonus aux dégâts de feu, de foudre et de froid.\n\nTags: Conjuration, Mana, Temps de recharge.",
					"itIT": "Il tempo di recupero o il costo in mana delle tue abilità d'Invocazione è ridotto del x10%. Infliggono anche danni aggiuntivi pari al x5% del bonus totale ai danni da fuoco, fulmine e freddo.\n\nTags: Invocazione, Mana, Tempo di recupero.",
					"jaJP": "召喚スキルのクールダウンまたはマナ消費量がx10%低下し、さらに火炎、電撃、冷気ボーナスダメージの合計のx5%相当のボーナスダメージを与える。\n\nTags: 召喚, マナ, クールダウン.",
					"koKR": "구현 기술의 재사용 대기시간 또는 마나 소모량이 x10% 감소합니다. 또한 해당 기술들이 화염, 번개, 냉기 총 추가 피해량의 x5%만큼 추가 피해를 줍니다.\n\nTags: 구현, 마나, 재사용 대기시간.",
					"plPL": "Twoje umiejętności Przyzywania mają skrócony czas odnowienia lub zmniejszony koszt many o x10%. Zadają też dodatkowe obrażenia równe x5% całkowitej premii do obrażeń od Ognia, Błyskawic i Zimna.\n\nTags: Przyzywanie, Mana, Odnowienie.",
					"ptBR": "Suas habilidades de Conjuração têm a recarga ou o custo de mana reduzido em x10%. Também causam dano equivalente a x5% do seu total de bônus de dano ígneo, elétrico e gélido.\n\nTags: Conjuração, Mana, Recarga.",
					"ruRU": "Сокращает время восстановления умений категории \"Колдовство\" и затраты маны на их применение на x10%. Урон от этих умений увеличивается на x5% от суммы бонусов к урону от огня, молнии и холода.\n\nTags: Колдовство, Мана, Время восстановления.",
					"trTR": "Büyü Yeteneklerinin Bekleme Süresi ve Mana bedeli x10% azalır. Ayrıca bu yetenekler toplam Ateşle, Yıldırımla ve Soğukla Hasar Bonusunun x5% kadarına eşit bonus hasar verir.\n\nTags: Büyü, Mana, Bekleme Süresi.",
					"zhCN": "你的召唤魔法技能的冷却时间或法力消耗减少 x10%, 其加成伤害相当于火焰伤害、闪电伤害和冰霜加成伤害总额的 x5%。\n\nTags: 召唤魔法, 法力, 冷却时间.",
					"zhTW": "你的咒喚技能冷卻時間或法力耗費降低 x10%。咒喚技能同時會造成額外傷害,等同火焰、閃電以及冰寒傷害加成加總值的 x5%。\n\nTags: 咒喚, 法力, 冷卻時間."
				}
			},
